import { directive } from '@babel/types';
import React, { Component } from 'react'
import { BrowserRouter as Router, Route, Switch} from "react-router-dom";
import Home from '../component/home/Home';
import WatchingVideo from '../component/watching/WatchingVideo'
import NewsFeed from '../component/newsFeed/NewsFeed'
import UserSub from '../component/userSub/UserSub'
export default function DieuHuongUrl() {
    const routes = [
        {
          path: "/",
          exact: true,
          main: () => <Home/>
        },
        {
          path: "/watching/:id",
          main: () => <WatchingVideo/>
        },
        {
          path: "/news",
          main: () => <NewsFeed/>
        }
      ];
        return (
            // <div>  
                <Switch>
                {routes.map((route, index) => (
              // Render more <Route>s with the same paths as
              // above, but different components this time.
              <Route
                key={index}
                path={route.path}
                exact={route.exact}
                children={<route.main />}
              />
            ))}
                         {/* <Route path="/watching/:id">
                            <WatchingVideo />
                        </Route>
                        <Route exact="/">
                            <Home />
                        </Route>
                        <Route path="/news">
                            <NewsFeed/>
                        </Route>
                        <Route path="/userSub">
                            <UserSub/>
                        </Route> */}

                </Switch>
            // </div>
           
        )
    }
